script: |
  super -f text -I q7832.spq | sort > q7832.out

inputs:
  - name: q7832.spq
    data: |
      SELECT DISTINCT + ( cor1.col0 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q7832.out
    data: |
      3
      64
      80
